import "./Experience.scss";

function Experience(prop) {
  return (
    <div className="experience">
      <h1>Frontend Engineer @ Modumate</h1>
      <h2>May 2021 - August 2021</h2>
      <ul style="list-style-image: url('/bullet.svg');">
         <li>Java</li>
         <li>C++</li>
         <li>Ruby</li>
      </ul>

    </div>
  );
}

export default Experience;
